import { useEffect, useState } from "react";
import "./Starship.scss";
import Footer from "../../components/Header&Footer/Footer";
import Header from "../../components/Header&Footer/Header";
import StarshipCard from "../../components/StarshipCards/StarshipCard";

interface IStaships {
  name: string;
  model: string;
  manufacturer: string;
  cost_in_credits: string;
  length: string;
  crew: string;
}

const Starship = () => {
  const [strashipData, setStarshipData] = useState<IStaships[]>([]);
  const [nextPage, setNextPage] = useState<string | null>(null);
  const [loading, setLoading] = useState<boolean>(false);
  const starshipUrl: any = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];

  const getPlanets = async (url: string) => {
    const response = await fetch(url);
    if (response.ok) {
      const data = await response.json();
      setStarshipData([...strashipData, ...data.results]);
      console.log(data.results);
      setNextPage(data.next);
    }
    setLoading(false);
  };

  useEffect(() => {
    const initialUrl = "https://swapi.dev/api/starships";
    getPlanets(initialUrl);
  }, []);

  const loadMorePeople = () => {
    if (nextPage && !loading) {
      getPlanets(nextPage);
    }
  };

  return (
    <>
      <Header />

      <section className="planets">
        <div className="planetsContainer">
          <p className="planetsParagraf">Starships</p>
          <div className="planetsGridBox">
            {strashipData.map((starship: any, index: number) => (
              <div key={index}>
                <StarshipCard
                  url={starshipUrl[index % starshipUrl.length]}
                  name={starship.name}
                  model={starship.model}
                  manufacturer={starship.manufacturer}
                  cost_in_credits={starship.cost_in_credits}
                  length={starship.length}
                  crew={starship.crew}
                />
              </div>
            ))}
          </div>
        </div>

        {nextPage && (
          <div className="load">
            <button className="loadMoreButton" onClick={loadMorePeople}>
              {loading ? "Loading..." : "Load more"}
            </button>
          </div>
        )}
      </section>

      <Footer />
    </>
  );
};
export default Starship;
